import React, {Component} from 'react';
import PC from './PC/PC';
import Mob from './Mob/Mob';
import "@fontsource/jura"; // Defaults to weight 400
import "@fontsource/jura/400.css"; // Specify weight

class App extends Component{
  constructor(props){
    super(props)
  }

  componentDidMount(){
    // console.log(this.props.app.port)
    // axios.get('http://localhost:3010/api/test').then(response => {
    //   console.log(response)
    // })
  }

  isMobile () {
    return (Environment.isAndroid() || Environment.isBlackBerry() || Environment.isIOS() || Environment.isOpera() || Environment.isWindows());
  }

  render(){
    console.log(this.isMobile())
    let isPC = (window.innerWidth>=1400)?true:false
    return(
      <div className='App'>
        {isPC?<PC/>:<Mob/>}
      </div>
    )
  }
}


export default App
